import './App.css';

function App() {
  return (
    <div className="App">
      <header class="header">
          <a href="#">Home</a>
          <a href="#">About</a>
          <a href="#">Contact Us</a>
          <a href="#">Profile</a>
        </header>
      <div class="doc-page">
        <div class="session">
          <h1> Session 1</h1>
        </div>
        <div class="current-session"></div>
      </div>
    </div>
  );
}

export default App;
